// A Linter which flags syntax errors from: https://discuss.codemirror.net/t/showing-syntax-errors/3111/6
function otherExampleLinter() {
    return linter((view) => {
        const diagnostics = [];
        syntaxTree(view.state).iterate({
            enter: n => {
                if (n.type.isError) {
                    diagnostics.push({
                        from: n.from,
                        to: n.to,
                        severity: "error",
                        message: "Syntax error.",
                    });
                }
            },
        });
        return diagnostics;
    });
}

